INSERT INTO `tbl_review` (`reviewid`,`header`,`rating`,`review`,`hotelid`,`BayesResult`,`BayesProb`,`UserName`) VALUES 
 (1,'stylish and classy',5,'a great hotel all round. Rooms are stylish and hotel staff are friendly and helpful. Fantastic location close to the airport for those early morning flights out of Pune. Great for business or pleasure',3,'positive',2.91038304567337e-011,NULL),
 (2,'Superb Service and food',5,'It\'s a superb place to have businesses meeting.... and one night stay the staff was very caring, friendly and pleasant. Room was superb and the food was very delicious well knowledgeable staff. I\'ll highly recommend hotel for the My friends and colleagues, excellent service by the hotel crew thanks for the same.',3,'positive',1.11022302462516e-016,NULL),
 (3,'Luxury in terms of everything... fantastic ambience',5,'I went to HYATT Pune for a business meeting. Fantastic meeting rooms with all necessary arrangements in place. In the evening the cocktail party was arranged. I must say that the ambiance in the hotel was outstanding.',3,'positive',3.63797880709171e-012,NULL),
 (4,'Comfortable for business stay',4,'Stayed at the hotel for four nights while on business travel. Hotel is relatively new and modern. Staff is very friendly and helpful. They also accommodated transfers from and to the airport, but this may have been the agreement with my company. Breakfast was really nice with a variety of \"Western\" fool as well as local dishes which were delicious....',3,'positive',4.33680868994202e-019,NULL),
 (5,'Great hospitality... Loved it',5,'I stayed at Hyatt for a couple of weeks and I must say that I had a great stay here Staff- superb Pool & gym- awesome Food- great . Specially the breakfast . Loved baked yogurt Room- very comfortable and spacious as well If u r looking for a hotel around Viman Nagar then this one definitely a must stay',3,'positive',1.73472347597681e-018,NULL),
 (6,'Just a casual visit to Pune',5,'A great hotel with good ambience and courteous staff. Value for money. Ensure to come back again and will stay at this location Service as usual is always good and the staff s well aware on the return of existing guest',3,'positive',5.11590769747272e-013,NULL),
 (7,'COZY ROOMS',5,'Hotel location is very close to the airport. Cozy rooms, The staff is courteous, some improvement needed in there response to requests, . The breakfast at ok. it has a very good restaurant at 2nd floor.',3,'positive',2.18278728425503e-011,NULL),
 (8,'Short business visit',5,'A very nice and stressfree hotel. The service is nothing short of amazing! You will feel right at home here. Perfect place to relax and recharge. The two hotel restaurants and bar is absolutely top class and the pool and spa area has a quiet relaxing atmosphere.',3,'positive',3.5527136788005e-015,NULL),
 (9,'Good place to stay',3,'The Hyatt in Pune is located reasonably close to the airport. Please remember to clarify to your cabbie or guests that you want to go or meet at Hyatt near Aga Khan Palace. People at times confuse with Hyatt Regency which too is located close by. Check for complementary airport pick up. It helps. The check in is smooth. The...',3,'positive',4.33680868994202e-019,NULL),
 (10,'Great Place for Stay and Food!',5,'It is always an Awesome experience at the Hyatt. Excellent food choices at the various restaurants. Ban Tao is especially good. Service is fantastic too. Worthy of a premium property. Good location and accessibility.',3,'positive',6.54836185276508e-011,NULL),
 (11,'Best wishes for Uttam',5,'I live in this hotel long time already. I want to thank my housekeeper Uttam, who cleans my room every day. I dont have any problem with water, towels or bath accessories. Always I have a clean room and bed linen. Thanks ;)',3,'positive',5.6843418860808e-014,NULL),
 (12,'Buffet Lunch at Eighty Eight',4,'I visited this place for the first time for a business team outing. We were around 20 people and booked in advanced for a buffet lunch. The price offered was decent. The appearance and atmosphere of the Restaurant was elegant and peaceful. There was no crowd at all when we were there. Sitting area was available in open air as...',3,'positive',4.33680868994202e-019,NULL),
 (13,'Best Leisure Hotel',5,'I stayed in the last month with family. Hotel has beautiful outdoor swimming pool. Lots of greenery around the pool area. We really enjoyed this pool view from my room. People are very helpful at restaurant. We had dinner at Pan Asian restaurant called Baan Tao . Amazing place to dine with the family. Loved water garden area. Thank you...',3,'positive',8.67361737988404e-019,NULL),
 (14,'Fantastic hotel',5,'I went to hyatt pune last year in November to enquire about their banqueting charges for my wedding. I obviously had seen a couple of other hotels too that day and by the time I reached Hyatt I pretty much knew the drill. As I walked in I was pleasantly surprised with the beautiful look and feel of the lobby,...',3,'positive',4.33680868994202e-019,NULL),
 (15,'Supercool place',5,'We had been to Hyatt\'s Italian restaurant. Food was good. Pure Italian taste. People who like bland taste and italian food, its a must visit place! Ambience is good for families/couples/friends. Clean and neat.Very sober place. Friendly staff.',3,'positive',6.82121026329696e-012,NULL),
 (16,'Pinnacle of service !!!',5,'I must say my dinner at Hyatt Pune was excellent just because of the king of service provided to me. Right from the reception to the restaurant all of them were really interested to make our visit memorable but there was this one person Shul Ambwani who is the director just came at the right time and made my dinner...',3,'positive',4.33680868994202e-019,NULL),
 (17,'Worst Dinner',2,'The quality of the food is really bad.You need to ask for everything including water. The buffet spread was very little with less variety. For that amount of money you can easily get better hotels. I would not recommend the hotel to anyone.',3,'negative',8.5265128291212e-014,NULL),
