 (101,'Simple hotel, big rooms and good food',4,'Very good welcome, and got a really big suite. All clean and tidy, internet fast and available. In noisy surroundings with a lot of celebrations going on which livens things up, but I guess most of Pune is pretty noisy. Open air bar on the roof, just the basics, but you can drink beer without airco which is great after...',5,'positive',6.50521303491303e-019,NULL),
 (102,'Wonderful, perfect staff!!!',5,'I had a business trip and travel from Mahad to Ahmednagar and decided to stay two nights in Pune shine I\'ve never visited before. I planned to book the car from Pune to Ahmednagar directly in the hotel. The staff is outstanding friendly and helpful! They gave me two options for car booking and assured I will reach Ahmednagar on...',5,'positive',4.33680868994202e-019,NULL),
 (103,'Comfortable Stay',5,'Nice hotel centrally located. Rooms are very comfortable and service is excellent. Price is also very reasonable. Food in room service was average. overall staff is very friendly and helpful. Hotel is very clean and well maintained. The rooms are very spacious and well equipped.',5,'positive',2.1316282072803e-014,NULL),
 (104,'Awsome and courteous staff',5,'The person in the banquet name Mr dipak is very helpfull.The food is also nice.Service of the hotel is fast.Special thanx to staff and employees of the hotel and Mr dipak.It is as good as home stay. The hotel is very nice and staff is very good',5,'positive',7.99360577730113e-015,NULL),
 (105,'Outstanding Service',5,'Great hotel situated in Koregaon Park.The staff are very friendly and courteous.Rooms are clean and spacious with bathrooms which have a spacious shower area and tub.Food was decent nothing exceptional,but overall I was very impressed with the service.',5,'positive',1.81898940354586e-012,NULL),
 (106,'very nice',5,'nice, modern, cozy, nice staff, nice rooms, nice bed, nice bathroom...everything is good about this hotel. location is in the center, bit crowded area, but good. very nice and helpful staff. very nice breakfast.',5,'positive',6.54836185276508e-011,NULL),
 (107,'SHOCKING & TRAUMATIC EXPERIENCE!!!',1,'My worst hotel and nightclub (Miami) ever!!! I checked into Executive room no 2018 on Saturday 18th March around 1.30 pm. First they gave me a smoking room on the 22nd Floor & said that the smell would go with room freshener. It did not & does not. So much they talk about environment, how about considering passive smoking. The...',7,'negative',9.75781955236954e-019,NULL),
 (108,'Great Staff, Great Hotel, Great Restaurant in Pune',5,'Was there on a business trip that also included using the conference and the ball rooms. Staff was really very attentive. They literally went out of their way to do the tasks. The rooms were also good and breakfast was really tasty. The very best thing was the roof restaurant though. Great view and really tasty Indian food. It is...',7,'positive',6.50521303491303e-019,NULL),
 (109,'Super place',5,'It\'s one of the awesome place to be, everything within the building itself. open air pasha lounge. superb rooms, executive lounge with good cocktails. kids area. Helpful and excellent staff. Miami club right in the building.',7,'positive',1.09139364212751e-011,NULL),
 (110,'the nice one hotel',5,'i got a chance in last july with my senior ,hotel is very ,which compete to hayaat regency , the rooms are nice ,view shows the city activities, mean while staff is good, in hotel all the facilities are available ,parking, wifi, etc',7,'positive',1.70530256582424e-013,NULL),
 (111,'Awesome experience and great hospitality',5,'I stayed over the weekend at this property and had an ammmmmazzzing time. Food, house keeping, room service, front office staff, night club....everything was a delight. I must complement the thought process behind each and every touch point for a customer was perfectly handled by JW Mariott Pune. The staff is super courteous and very warm with never say no...',7,'positive',4.33680868994202e-019,NULL),
 (112,'Awesome Hotel',5,'It is a awesome hotel. Attraction is its rooms, hospitality, food, staff and amenities. I like hotel very much. It is really one of the best hotels i have ever visited. Vehicle parking is very good which they can park them self and provide you when you want.',7,'positive',4.44089209850063e-015,NULL),
 (113,'Very good hotel',5,'The hotel is very good but the difference is done by the employees, a special thanks to the guest relations manager Lovely Srivastava and to Vaishali (23rd floor manager). The hotel has 4 restaurants that are very good.',7,'positive',4.09272615797818e-012,NULL),
 (114,'Luxury and very friendly and attentive staff',5,'I stayed for a congress for four nights and enjoyed the feeling of warm luxury, gentle and attentive staff that always followed to show, hospitality, excellent foods, the generous room equipped with desk and sofa, the gym and pool. Pool is 16 or 20 meters long and good for swimming, good water, not just for decorative purposes. The gym is...',7,'positive',4.87890977618477e-019,NULL),
 (115,'Business Trip',5,'Excellent Hotel. The room was superb and all of the restaurants are super good. Especially pasha at the last floor. A special thanks to Lovely who made me feel home and to the Bar Manager @23 floor, she\'s super kind.',7,'positive',6.82121026329696e-013,NULL),
 (116,'Lovely stay as always...',5,'Our second visit to this property.. Wonderful stay.. every thing personally? attended... Felt welcome .. we were offered complimentary b fast ... So good to be a Marriott . Member.. the restaurant are good. Perfectly blending local and international flavours. Good B fast with multiple options to select from.. loved the healthy juices.. staff was very friendly !! Rooms: clean...',7,'positive',2.34187669256869e-017,NULL),
 (117,'Best Service Experience',5,'This is one of the best dinner have ever been on. We loved the vibrant lobby and the staff was amazing. I am vegetarian and my wife is hard core non vegetarian. Going to an Italian restaurant always ends up with my consuming drinks and not the food. As I do not prefer cheese the same need was told and...',10,'negative',9.75781955236954e-019,NULL),
 (118,'First time at the Westin Pune',5,'Excellent place to stay in Pune. I was there for eight nights. I have stayed in other hotels during my visits to Pune and this property was clearly superior. The rooms were clean and orderly. The food was very good but the highlight was the staff. They were extremely professional, courteous, friendly and very responsive to any needs or questions....',10,'positive',6.50521303491303e-019,NULL),
 (119,'BY FAR THE BEST HOTEL IN PUNE (Reeks of Luxury)',5,'This is one property where you can demand only the best in every aspect as they strive only to deliver very high standards of service. I am simply in love with the CLUB LOUNGE and spend most of my time there. The lounge terrace is wonderful in the mornings and after sunset. One can expect very high quality of food...',10,'positive',6.50521303491303e-019,NULL),
 (120,'FINE DINE',5,'It had been a while that I had been to a fine dine restaurant and was a tad sad about not being able to make it evertime . As things would have it, I eventually made it? Prego, for its amazing lively decor and amazing food takes a chance to get rated Amazingly high. The restaurant manager Edward was very...',10,'negative',9.75781955236954e-019,NULL),
 (121,'Heavenly weekend with an incredible experience!!',5,'I went with my family & we stayed at Club Suites at Westin Koregaon Park. Fantastic & Pleasant Ambiance. Adorable hospitality shown by the staffs. Amazing food treat for lunch? at Seasonal Taste ?\" The spread out menu with range of options from soups and chaat to cuisines like East Asian, Continental and our very own Indian menu. In the...',10,'positive',7.2280143109074e-019,NULL),
 (122,'Business hotel but good for family',5,'This was my second visit in a month\'s time. A good hotel in hospitality. They are really good in taking care of their guest. Food is good and we all enjoy their lounge. The best part about their lounge is that the chef takes good care of you. With a smiling face they are every ready to cater to your...',10,'positive',2.19550939928315e-018,NULL),
 (123,'All under the same roof.',5,'Been spent quite a lot of years In Arab , so when a food festival comes along it also brings in memories. Flavors Of Arbia at The Westin Pune wins the game. With such themed ambience, having a hostess dressed as an Arabic female was the eye catch at the entrancr itself. With prompt services of Kanika , Sunil and...',10,'positive',1.73472347597681e-018,NULL),
 (124,'Business event at Westin',5,'Good banquet hall & location. Great service as well. Cooperative and helpful staff, meeting most of the requirements The executive lounge staff offers personalized service and great ambiance. Overall great experience hosting our corporate event here',10,'positive',1.09139364212751e-011,NULL),
 (125,'Dinner',4,'We visit the hotel quiet often and every time our experience is extremely satisfactory... today we enjoyed our dinner at Seasonal Tastes... It was Arabic spread with delicious food items... we were personally served by Mr. Vivek Gourh and Mr. Yogesh Deore... I must admit the staff is really commendable with their service .. They all doing a good job!!...',10,'positive',1.30104260698261e-018,NULL),
 (126,'Better than my last experience',4,'short stay for a conference.....Except the Check-in,where the front office staff took forever to allot a room...rest stay was all ok......will probably stay here again.....The location is excellent and the service this time was also very good....they have raised their levels from the last time i was here....',10,'positive',1.77635683940025e-015,NULL),
